import { ReactElement } from 'react';
import { Portfolio } from './interfaces';

interface PortfolioDetailProps {
    portfolio: Portfolio;
}

function BuyForm({portfolio}: PortfolioDetailProps): ReactElement {
    return (
        <div id="searchFormDiv">
            <form id="searchForm">
                <label htmlFor="tickerInput">Ticker:</label>
                <br></br>
                <input type="text" id="tickerInput" name="tickerInput"/>
                <input type="submit" value="Submit"/>
            </form>
            <p id="priceDisplay">
                Price will show here
            </p>
            <form id="buyForm">
                <label htmlFor="quantityInput">Quantity:</label>
                <br></br>
                <input type="text" id="quantityInput" name="quantityInput"/>
                <input type="submit" value="Buy"/>
            </form>
        </div>
    )   
}

export default BuyForm;
